import React from 'react';
import classes from './Projects.module.css';
import Project from './Project/Project';

const projects = () => {
    return (
        <div className={classes.Projects}>
            <div className={classes.ProjectsContainer}>
                <Project />
                <Project />
                <Project />
                <Project />
            </div>
        </div>
    )
}

export default projects;
